using Main.SupportingComponents;

namespace Main.Day4
{
    public class Challenge : BaseChallenge
    {
        public override Day Day => Day.Four;

        public override Task<Solution> SolvePart1Async(InputType inputType)
        {
            var input = Input.GetInput(inputType);

            var wordsearch = MultidimensionalArrayParser.Parse2DArray(input);
            var wordsFound = 0;
            for (var row = 0; row < wordsearch.NumberOfRows(); row++)
            {
                for (var column = 0; column < wordsearch.NumberOfColumns(); column++)
                {
                    var currentLetter = wordsearch[row, column];
                    if (currentLetter is WordsearchLetters.X)
                    {
                        wordsFound += wordsearch.CountXmasWordsFromPosition(row, column);
                    }
                }
            }

            return Task.FromResult(new Solution($"Words Found: {wordsFound}"));
        }

        public override Task<Solution> SolvePart2Async(InputType inputType)
        {
            var input = Input.GetInput(inputType);

            var wordsearch = MultidimensionalArrayParser.Parse2DArray(input);
            var wordsFound = 0;
            for (var row = 0; row < wordsearch.NumberOfRows(); row++)
            {
                for (var column = 0; column < wordsearch.NumberOfColumns(); column++)
                {
                    var currentLetter = wordsearch[row, column];
                    if (currentLetter is WordsearchLetters.A)
                    {
                        wordsFound += wordsearch.CountX_MasWordsFromPosition(row, column);
                    }
                }
            }

            return Task.FromResult(new Solution($"Words Found: {wordsFound}"));
        }

